    modifier onlyOwner() {
        require(msg.sender == owner, "This function can only be called by the owner");
        _;
    }

    function setNewOwner(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Invalid address");
        owner = _newOwner;
    }

